  const BASE_URL = 'https://frontend-test-assignment-api.abz.agency';


  const getToken = () => {

      fetch('https://frontend-test-assignment-api.abz.agency/api/v1/token')
      .then(function(response) { return response.json(); })
      .then(function(data) { console.log(data); })
      .catch(function(error) {  });
  }

  const getContacts = () => {
    fetch('https://frontend-test-assignment-api.abz.agency/api/v1/users?page=1&count=5')
    .then(function(response) { return response.json(); })
    .then(function(data){ 
        console.log(data); 
      }
    )
  }

const getPositions = () => {
  fetch('https://frontend-test-assignment-api.abz.agency/api/v1/positions')
  .then(function(response) { return response.json(); })
  .then(function(data) { console.log(data); })
}

  return (
    <div>
      <h1>React app</h1>
      <button onClick={getToken}>Get Token</button> <br/>
      <button onClick={getContacts}>Get Contacts</button> <br />
      <button onClick={getPositions}>Get Position</button>
    </div>
  );
}

export default App;
